import React from 'react';
import Navbar from './components/navbar';
import Hero from './components/hero';
import About from './components/about'; // Import the About component
import Testimonials from './components/testimonials';
import Services from './components/services';
import PropertyListing from './components/propertylisting';
import Team from './components/team'; // Import the Team component
import Contact from './components/contact';
import Footer from './components/footer';
import './index.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Hero />
      <About /> {/* About comes right after Hero */}
      <Services /> {/* Services now follow About */}
      <Testimonials />
      <PropertyListing /> {/* Property Listing */}
      <Team /> {/* Team section placed after Property Listing */}
      <Contact /> {/* Contact comes after Team */}
      <Footer />
    </div>
  );
}

export default App;
